import React from 'react'
import styled from 'styled-components'
const StyledAvatar = styled.div`

    border: solid black;
    position: relative;

    left: 700px;
    img{
        width: 80px;
        height: 70px;
    }
`
export function Avatar() {
    return (
        <StyledAvatar>
            <img src="https://cdn-icons-png.flaticon.com/512/147/147144.png" alt="{props.user.name}" />
        </StyledAvatar>
    )
}
